import Link from "next/link";
const NaveBar = () => (
  <nav>
    <div className="conten-nav d-flex">
      <Link href="/create">
        <button className="btn"> Create </button>
      </Link>

      <button className="btn"> Delete </button>
    </div>
  </nav>
);
export default NaveBar;
